import { CollegeApi } from "../constant/constant";

////////////////////////////////////////////////////////// AUTH //////////////////////////////////////////////////////////

export const CollegeLoginApi = async (form_data) => {
    try {
        const { data } = await CollegeApi.post('/login', form_data)
        return data;
    } catch (error) {
        return false
    }
}

//////////////////////////////////////////////////////////

export const CollegeAuthApi = async (token) => {
    try {
        const { data } = await CollegeApi.post('/auth', {}, { headers: { "collegetoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

////////////////////////////////////////////////////////// STUDENT //////////////////////////////////////////////////////////

export const CollegeStudentList = async (token) => {
    try {
        const { data } = await CollegeApi.get('/student/list', { headers: { "collegetoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

//////////////////////////////////////////////////////////

export const CollegeStudentDelete = async (_id, token) => {
    try {
        const { data } = await CollegeApi.delete(`/student/delete?_id=${_id}`, { headers: { "collegetoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

////////////////////////////////////////////////////////// MENU //////////////////////////////////////////////////////////

export const CanteenMenuCreate = async (token, form_data) => {
    try {
        const { data } = await CanteenApi.post('/menu/create', form_data, { headers: { "canteentoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

//////////////////////////////////////////////////////////

export const CanteenMenuList = async (token) => {
    try {
        const { data } = await CanteenApi.get('/menu/list', { headers: { "canteentoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

//////////////////////////////////////////////////////////

export const CanteenMenuUpdate = async (token, form_data) => {
    try {
        const { data } = await CanteenApi.patch('/menu/list', form_data, { headers: { "canteentoken": token } })
        return data;
    } catch (error) {
        return false
    }
}

//////////////////////////////////////////////////////////

export const CanteenMenuDelete = async (token, _id) => {
    try {
        const { data } = await CanteenApi.delete(`/menu/delete?_id=${_id}`, { headers: { "canteentoken": token } })
        return data;
    } catch (error) {
        return false
    }
}
